"use strict";(()=>{var i=class{constructor(){this.init(),window.loadScript("https://cdn.jsdelivr.net/npm/alpinejs@3.14.9/dist/cdn.min.js",{placement:"head",name:"alpinejs-script"},{defer:"false",async:"true"}).then(()=>{console.debug("AlpineJS init")})}init(){document.querySelectorAll("[x-data] [x-for]:not(template), [x-data] [x-if]:not(template)").forEach(t=>this.wrapInTemplate(t))}getAlpineAttributes(t){let e=[];for(let a=0;a<t.attributes.length;++a){let n=t.attributes[a];n.name.startsWith("x-")&&e.push(n)}return e}wrapInTemplate(t){let e=document.createElement("template");this.getAlpineAttributes(t).forEach(n=>{e.setAttribute(n.name,n.value),t.removeAttribute(n.name)}),t.parentNode?.insertBefore(e,t),e.content.appendChild(t)}};new i;})();
